    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE + col0 * - ( - - 91 ) - - col1 + col2 + col2 * + col2 NOT BETWEEN 25 + - col0 * + col2 AND + col2;
  - name: tab0

outputs:
  - name: q8950.out
    data: |
      15	81	47
      87	21	10
      97	1	99
